ReactDOM.render(
                <>
                <h1>List of Top 5 Netflix web Series</h1>
                <div className="Main">
                        {Sdata.map( (val)=>{
                                          return( <Card imgSrc={val.img} 
                                                      title={val.title}
                                                      sname={val.name} 
                                                      link={val.link}/>
                                                );
                                          } 
                              )
                        }
                  </div>
                </>,
                document.getElementById("root")

);
